The Three Musketeers speelt zich af in de 17e eeuw en gaat over D'Artagnan die in zijn strijd met Kardinaal Richelieu de samenwerking aangaat met de drie musketiers Athos, Porthos en Aramis. D'Artagnan kan de hulp goed gebruiken en samen met de drie musketiers probeert hij de snode plannen van Kardinaal Richelieu, om de koning tot aftreden te dwingen, te dwarsbomen.



